import React from "react";
import { Routes, Route } from "react-router-dom";

import Home from "./../pages/Home";

import Cars from "../pages/Cars";
import CarDetails from "../pages/CarDetails";
import Login from "../pages/Login";
import Register from "../pages/Register";
import ThankYou from "../pages/ThankYou";
import SearchResultList from "../pages/SearchResultList";
import AdminHome from "../pages/AdminHome";
import Users from "../pages/Users";
import Carsadmin from "../pages/Carsadmin";
import Bookings from "../pages/Bookings";
import Userbookings from "../pages/Userbookings";
import Profile from "../pages/Profile";
import { AdminRoutes, Main, isAuth } from "../context/AuthContext";
import PaymentForm from "../pages/PaymentForm";
import Booked from "../pages/Booked";

const Router = () => {
  let isadmin = isAuth();
  return (
    <Routes>
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />
      <Route path="/" element={<Home />} />
      <Route path="/" element={<Cars />} />


      <Route
        path="/home"
        element={
          <AdminRoutes token={isadmin}>
            <Main child={<Home />} />
          </AdminRoutes>
        }
      />{" "}
      <Route
        path="/cars"
        element={
          <AdminRoutes token={isadmin}>
            <Main child={<Cars />} />
          </AdminRoutes>
        }
      />
      <Route
        path="/cars/:id"
        element={
          <AdminRoutes token={isadmin}>
            <Main child={<CarDetails />} />
          </AdminRoutes>
        }
      />
      <Route
        path="/payment/:bookingid"
        element={
          <AdminRoutes token={isadmin}>
            <Main child={<PaymentForm />} />
          </AdminRoutes>
        }
      />
      <Route
        path="/thank-you"
        element={
          <AdminRoutes token={isadmin}>
            <Main child={<ThankYou />} />
          </AdminRoutes>
        }
      />
      <Route
        path="/booked"
        element={
          <AdminRoutes token={isadmin}>
            <Main child={<Booked />} />
          </AdminRoutes>
        }
      />
      <Route
        path="/car/search"
        element={
          <AdminRoutes token={isadmin}>
            <Main child={<SearchResultList />} />
          </AdminRoutes>
        }
      />
      <Route
        path="/adminHome"
        element={
          <AdminRoutes token={isadmin}>
            <Main child={<AdminHome />} />
          </AdminRoutes>
        }
      />
      <Route
        path="/users"
        element={
          <AdminRoutes token={isadmin}>
            <Main child={<Users />} />
          </AdminRoutes>
        }
      />
      <Route
        path="/carsadmin"
        element={
          <AdminRoutes token={isadmin}>
            <Main child={<Carsadmin />} />
          </AdminRoutes>
        }
      />
      <Route
        path="/bookings"
        element={
          <AdminRoutes token={isadmin}>
            <Main child={<Bookings />} />
          </AdminRoutes>
        }
      />
      <Route
        path="/userbookings"
        element={
          <AdminRoutes token={isadmin}>
            <Main child={<Userbookings />} />
          </AdminRoutes>
        }
      />
      <Route
        path="/profile"
        element={
          <AdminRoutes token={isadmin}>
            <Main child={<Profile />} />
          </AdminRoutes>
        }
      />
    </Routes>
  );
};

export default Router;
